IF OBJECT_ID('dbo.proc_transform_117', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_117;
GO
CREATE PROCEDURE dbo.proc_transform_117
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_117
    SET payload = LEFT(payload, 1000) + N'|V4-117|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_117;
END
